window.bookSummaryJSON = "<p>Jack Reilly's luck ran out just before the war did. Resigning his commission in the Alliance shortly after the end of the war with the Serkins, he went out into the galaxy looking for a job. Signing onto the <i>Glacier Runner 17</i>, an old and rundown cargo ship, Reilly finds himself working for a clueless captain, mixed up in an intergalactic conspiracy, on the run from assassins, and involved with two women in relationships that he could only call \"complicated\".</p> <p>And that's just book one. Follow Lt. Jack Reilly and his partner, Major Mitchel, through their adventures.</p> <p>Bundle pack includes:</p> <p><b><i>Lt. Reilly 2321</i></b></p> <p><b><i>Lt. Reilly and the Backbird Offensive</i></b></p> <p><b><i>Lt. Reilly and the Phantom Raptor</i></b></p> <p><b><i>Major Mitchell and the Carplex Conspiracy</i></b></p> <p><b><i>Lt. Reilly and the Tansky Gambit</i></b></p>"; 
